import groovy.json.JsonSlurper
import java.nio.charset.StandardCharsets

// Get the flow file content
def flowFile = session.get()
def flowFileContent = session.read(flowFile).text

// Parse the JSON content
def jsonSlurper = new JsonSlurper()
def jsonObject = jsonSlurper.parseText(flowFileContent)

// Get the names of each list in the JSON object
def listNames = jsonObject.collect { key, value ->
    if (value instanceof List) {
        key
    } else {
        null
    }
}.findAll { it != null }

// Count the number of values in the list
def numberOfValues

try { 
  numberOfValues = listNames.size();
} catch(Exception ex) {
  numberOfValues = 0;
}


def joltSpecString = ""

// Create a string representation of the JOLT spec
if (numberOfValues > 0){
  joltSpecString = """
    [{
      "operation": "shift",
      "spec": {
        "*": "&",
        ${listNames.collect { name -> "\"${name}\": { \"*\": \"&1-&\" }" }.join(',\n    ')}
      }
    }]
"""
} else {
  joltSpecString = """
    [{
      "operation": "shift",
      "spec": {
        "*": "&"
      }
    }] 
"""
}

// Log the JOLT spec string (optional)
log.info("JOLT spec string:\n${joltSpecString}")

// Set the JOLT spec string as an attribute
flowFile = session.putAttribute(flowFile, 'joltSpec', joltSpecString)

// Transfer the flow file to success relationship
session.transfer(flowFile, REL_SUCCESS)

