import groovy.json.JsonSlurper
import groovy.json.JsonBuilder

def flowFile = session.get()

if (!flowFile) return

def attrs = [:] as Map<String, String>


flowFile = session.write(flowFile, { rawIn, rawOut ->
    rawIn.withReader("UTF-8") { reader ->
        rawOut.withWriter("UTF-8") { writer ->

            def obj = new JsonSlurper().parse(reader)

            if (obj.containsKey("Accuracy") && !obj.Accuracy.isNumber()){ 
                obj.Accuracy = obj.Accuracy.replace(',','.')  
            }
            if (obj.containsKey("Longitude") && obj.Longitude != "" && !obj.Longitude.isNumber()){ 
                obj.Longitude = obj.Longitude.replace(',','.')  
            }
            if (obj.containsKey("Latitude") && obj.Latitude != "" && !obj.Latitude.isNumber()){ 
                obj.Latitude = obj.Latitude.replace(',','.')  
            }
            if (obj.containsKey("StartLongitude") && obj.StartLongitude != null){ 
                obj.StartLongitude = obj.StartLongitude.replace(',','.')  
            }
			else obj.put("StartLongitude", 0)

            if (obj.containsKey("StartLatitude") && obj.StartLatitude != null){ 
                obj.StartLatitude = obj.StartLatitude.replace(',','.')  
            }
			else obj.put("StartLatitude", 0)

			obj.put("id", flowFile.getAttribute("id"))
			obj.put("form_id", flowFile.getAttribute("form_id"))
            obj.put("company_id", flowFile.getAttribute("company_id"))
            obj.put("outlet_id", flowFile.getAttribute("outlet_id"))
            obj.put("user_id", flowFile.getAttribute("user_id"))
            obj.put("date", flowFile.getAttribute("date"))
            obj.put("created_at", flowFile.getAttribute("created_at"))
            obj.put("updated_at", flowFile.getAttribute("updated_at"))
            obj.put("verified", flowFile.getAttribute("verified"))
            obj.put("declined", flowFile.getAttribute("declined"))
            obj.put("processed", flowFile.getAttribute("processed"))
            obj.put("app_version", flowFile.getAttribute("app_version"))

            obj.each { k, v ->
                attrs[k] = v.toString()
            }

            new JsonBuilder(obj).writeTo(writer)
        }
    }
} as StreamCallback)

flowFile = session.putAllAttributes(flowFile, attrs)

session.transfer(flowFile, REL_SUCCESS)

